import React from "react";
import DescCoinprice from "./DescCoinPrice";
import Desc24hrHigh from "./Desc24hrHigh";
import Desc24hrLow from "./Desc24hrLow";
import DescCirculating from "./DescCirculating";
import DescDescription from "./DescDescription";
import DescImage from "./DescImage";
import DescMarketCap from "./DescMarketCap";
import DescName from "./DescName";
import DescRank from "./DescRank";
import DescSymbol from "./DescSymbol";

const CoinDescription = (props) => {
  return (
    <>
      <DescCoinprice desccoinprice={props.descCoinPrice} />
      <Desc24hrHigh desc24hrhigh={props.desc24HrHigh} />
      <Desc24hrLow desc24hrlow={props.desc24HrLow} />
      <DescCirculating desccirculating={props.descCirculating} />
      <DescDescription descdescription={props.descDescription} />
      <DescImage descimage={props.descImage} />
    </>
  );
};

export default CoinDescription;
